import { Route, Routes } from "react-router";
import Navbar from './components/Navbar'

const App = () => {
  return (
    <>
      <Routes>
        <Route path="/" element={<h1>Bienvenidos a TMDB</h1>}/>
      </Routes>
    </>
  );
};

export default App;
